import React, { useState } from 'react';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';

const SchoolFoodComponent = () => {
    const [startMonth, setStartMonth] = useState(null);
    const [endMonth, setEndMonth] = useState(null);
    const [classValue, setClassValue] = useState('');
    const [nameValue, setNameValue] = useState('');
    const [surnameValue, setSurnameValue] = useState('');
    const [codeValue, setCodeValue] = useState('');
    const [hasContract, setHasContract] = useState(null);
    const [isPaid, setIsPaid] = useState(null);
    const [updateStatus, setUpdateStatus] = useState(null);
    const [error, setError] = useState(null);

    const handleUpdateData = async () => {
        try {
            if (startMonth && endMonth && startMonth >= endMonth) {
                setError('Start Month must be greater than or equal to End Month.');
                return;
            }

            const response = await fetch('https://localhost:7045/SchoolFood/update-data', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    StartDate: startMonth,
                    EndDate: endMonth,
                    Class: classValue,
                    Name: nameValue,
                    Surname: surnameValue,
                    Code: codeValue,
                    HasContract: hasContract,
                    IsPaid: isPaid,
                }),
            });

            const data = await response.json();

            if (data.success) {
                setUpdateStatus('Data successfully updated');
            } else {
                setUpdateStatus(data.message);
            }
        } catch (error) {
            console.error('Error updating data:', error);
            setUpdateStatus('Error updating data');
        }
    };

    return (
        <div>
            <h1>School Food Tracker</h1>
            <label>
                Start Month:
                <DatePicker selected={startMonth} onChange={(date) => setStartMonth(date)} dateFormat="MM/yyyy" showMonthYearPicker />
            </label>
            <label>
                End Month:
                <DatePicker selected={endMonth} onChange={(date) => setEndMonth(date)} dateFormat="MM/yyyy" showMonthYearPicker />
            </label>
            <label>
                Class:
                <input type="text" value={classValue} onChange={(e) => setClassValue(e.target.value)} />
            </label>
            <label>
                Name:
                <input type="text" value={nameValue} onChange={(e) => setNameValue(e.target.value)} />
            </label>
            <label>
                Surname:
                <input type="text" value={surnameValue} onChange={(e) => setSurnameValue(e.target.value)} />
            </label>
            <label>
                Code:
                <input type="text" value={codeValue} onChange={(e) => setCodeValue(e.target.value)} />
            </label>
            <label>
                Has Contract:
                <select value={hasContract} onChange={(e) => setHasContract(e.target.value)}>
                    <option value={null}>Select</option>
                    <option value={true}>Yes</option>
                    <option value={false}>No</option>
                </select>
            </label>
            <label>
                Is Paid:
                <select value={isPaid} onChange={(e) => setIsPaid(e.target.value)}>
                    <option value={null}>Select</option>
                    <option value={true}>Yes</option>
                    <option value={false}>No</option>
                </select>
            </label>
            <button onClick={handleUpdateData}>Update Data</button>
            {error && <p style={{ color: 'red' }}>{error}</p>}
            {updateStatus && <p>{updateStatus}</p>}
        </div>
    );
};

export default SchoolFoodComponent;
